const Player: React.FC = () => {
  return (
    <div className="single-item">
      <div className="single-item__wrapper">
        <div className="single-item__top"></div>
        <div className="single-item__content">
          <div className="single-item__photo"></div>
          <div className="single-item__info">
            <div className="single-item__title"></div>
          </div>
          <p>Player</p>
        </div>
      </div>
    </div>
  );
};

export default Player;
